INSERT INTO `Blog_Forum_post` VALUES (1,'Mohamed Massal GUEYE','Coordonnateur et Administrateur LES','Prudence sur le choix des orientations !','Le choix de l’orientation va de pair avec la réussite du Baccalauréat. L’année où vous faites la classe de  Terminale doit donc impérativement être la finalisation du choix d’études et donc la connaissance des métiers attachés car le timing des inscriptions sur le portail Campusen laisse peu de temps au flou et à l’indécision .\r\n\r\nFaites attention au choix du type de formations lorsque votre option de filière est déterminée : parfois, plusieurs types de formation mènent au même métier. Il est donc essentiel de choisir celui qui correspond le mieux à votre profil et à vos  besoins (ou pas) d’encadrement (université Vs école).\r\n\r\nComment réussir sa formation en quelques points : \r\n• Faites un bilan de personnalité et de compétences. Apprendre à se connaitre est la condition sine qua non pour établir un projet d’orientation pertinent. Si vous êtes hésitant, ou émettez des choix très contrastés,  faites le point sur vos aspirations, vos matières préférées, votre personnalité, votre façon  de travailler, vos valeurs, vos hobbies, en un mot faites une analyse de vous-même . Grâce à ce  travail fait en amont , vous allez non seulement préciser vos choix mais aussi resserrer vos recherches.\r\n \r\n• Multipliez les recherches et les visites sur les salons dédiés aux études supérieures. Une fois les choix de filières déterminés, il est indispensable d’examiner ces branches d’études afin de trouver la formation la plus adéquate avec votre profil et vos projets : Université ou école ? Formation courte ou longue ? Formation sélective ou non ?\r\nLes sources d’informations sont nombreuses : le site Campusen , les sites des universités et écoles, les salons et forums dédiés à l’orientation … Les Journées Portes Ouvertes sont également très utiles pour découvrir de l’intérieur l’établissement et dialoguer à la fois avec les étudiants et les responsables pédagogiques.\r\n \r\n• Organisez des rencontres avec des amis ou parents dont les métiers pourraient vous intéresser . L’idée est que vous compreniez le contenu des métiers, la réalité de l’entreprise au travers de témoignages réels.  Interrogez vos enseignants, interviewez des professionnels de votre entourage et idéalement rencontrez un conseiller d’orientation qui apprendra à vous connaître et vous guidera dans le vaste monde du supérieur.\r\n \r\n•  Préparez-vous aux sélections des établissements. Pour être admis dans certaines formations, y compris celles des Grandes écoles,  en plus de l’étude du dossier scolaire, il est parfois nécessaire de réussir des épreuves de sélection écrites et/ou orales. Concours, entretien de motivation … vont ainsi venir s’ajouter aux révisions du Bac : il est donc nécessaire d’anticiper ce surplus de travail et de stress dans votre planning . Les épreuves écrites et orales d’admission sont propres à chaque école ou groupe d’écoles (bureau des concours) il faut donc s’entrainer pour en comprendre la logique.','posts/orientation_question.jpg','2020-08-28 01:23:43.096735','2020-08-20 23:33:29.954155','E-learning'),(2,'Mouhamed Massal GUEYE','Coordonnateur et Administrateur LES','Gestion du temps : bien planifier votre temps pour décrocher le baccalauréat','Dès les  vacances, vous devez commencer à vous mettre mentalement en « mode révision». En effet, c’est la période la plus  propice pour mettre en place une méthodologie et établir un planning hebdomadaire de révision afin de se placer dans les meilleures conditions possibles pour bien attaquer  le dernier trimestre de cours et la préparation du Baccalauréat.\r\n \r\n• Travaillez le programme, et tout le programme ! Vous devez, pour chaque matière,  maitriser parfaitement les cours et connaitre l’étendue des connaissances exigées pour l’examen. Cela signifie bien sûr que vous ne devez faire d’impasse sur  aucune partie du programme. Les prédictions de sujets des magazines ou autres mauvais informateurs ne sont que rarement avérées, et l’enjeu est trop grand pour prendre des risques inutiles. Même s’il est dès fois compliqué de tout maitriser essayer d’avoir des connaissances sur tout , mieux vaut avoir un 6/20 qu’un 0/20 !\r\n \r\n• Continuez à travailler vos points faibles ... La réussite du Baccalauréat se jouera en partie sur la capacité que vous avez à limiter les dégâts sur les matières où vous vous sentez le plus faible, si toutefois vous en avez. Vous devrez donc redoubler d’efforts afin d’acquérir un niveau convenable. N’hésitez pas à vous  faire accompagner par un enseignant si les difficultés sont vraiment importantes et si vous en avez les moyens, notamment pour que vous puissiez retrouver confiance en  vos aptitudes à gérer ces matières. Dans le cas où vous n’avez pas cette possibilité de vous faire accompagner, pas de panique ! A force de s’exercer on arrive à bout de toutes les difficultés ! N’ayez pas honte de poser  des questions à votre professeur ou même à vos camarades et privilégiez le travail de groupe.\r\n \r\n• … Et maitrisez à 100 % vos points forts. Il est important de cultiver vos matières de prédilection afin de gagner le plus de points possible. Elles sont donc à travailler jusqu’au bout.\r\n \r\n• Efforcez-vous à consulter  continuellement  les annales d’examen. Regroupant des sujets d’examen qui évaluent les connaissances issues des différentes parties du programme, les annales permettent de vérifier que tout est acquis et que vous êtes capable de mettre en application les notions de cours apprises tout au long de l’année. Il est donc indispensable que vous vous confrontiez aux annales, et ce dans les conditions de l’épreuve : le temps imparti doit être respecté, le smartphone éteint dans une autre pièce et toutes autres sollicitations éloignées. \r\nAttention ! Il est important de  noter que les annales doivent être abordés une fois les connaissances acquises et maitrisées ,sinon , tout ce que vous réussirez à faire, c’est de vous  décourager rapidement.\r\n \r\n• Accordez-vous des temps de repos et de relaxation !  Vous aurez sans doute du mal à rester focalisé pendant cette longue période au même rythme et dans des conditions de concentration satisfaisantes. L’équilibre physique et mental, ainsi que la sérénité sont des conditions essentielles de réussite. Continuez donc à faire du sport et à pratiquer vos activités, tout en  - peut-être - ralentissant le rythme progressivement, jusqu’à l’approche de l’examen.','posts/4_Fhn6nwk.jpg','2020-08-28 01:27:06.444341','2020-08-26 10:20:42.515645','E-learning');
